# ==========================================
# INVERSE KINEMATICS
# ==========================================

def ik_foot_to_motor(pitch, roll):
    """
    Compute motor angles from foot angles.
    
    Args:
        pitch: Foot pitch angle [rad]
        roll: Foot roll angle [rad]
    
    Returns:
        (q_lower, q_upper): Motor angles [rad]
    """
    s1 = _ik_q_lower_sol1(pitch, roll)
    s2 = _ik_q_lower_sol2(pitch, roll)
    q_lower = s1 if abs(s1) < abs(s2) else s2
    
    s1 = _ik_q_upper_sol1(pitch, roll)
    s2 = _ik_q_upper_sol2(pitch, roll)
    q_upper = s1 if abs(s1) < abs(s2) else s2
    
    return (q_lower, q_upper)

# ==========================================
# FORWARD KINEMATICS
# ==========================================

def _fk_lut_lookup(q_lower, q_upper):
    """
    LUT lookup with bilinear interpolation.
    Returns (pitch, roll) or (nan, nan) if outside valid workspace.
    """
    fi = (q_lower - _FK_Q_LOWER_MIN) / _FK_Q_STEP
    fj = (q_upper - _FK_Q_UPPER_MIN) / _FK_Q_STEP
    
    i0 = int(math.floor(fi))
    j0 = int(math.floor(fj))
    
    # Check bounds
    if i0 < 0 or i0 >= _FK_Q_LOWER_SIZE - 1 or j0 < 0 or j0 >= _FK_Q_UPPER_SIZE - 1:
        return (float('nan'), float('nan'))
    
    i1 = i0 + 1
    j1 = j0 + 1
    
    # Get corner values
    p00, p10 = _fk_lut_pitch[i0][j0], _fk_lut_pitch[i1][j0]
    p01, p11 = _fk_lut_pitch[i0][j1], _fk_lut_pitch[i1][j1]
    r00, r10 = _fk_lut_roll[i0][j0], _fk_lut_roll[i1][j0]
    r01, r11 = _fk_lut_roll[i0][j1], _fk_lut_roll[i1][j1]
    
    # Check for NaN corners
    if (math.isnan(p00) or math.isnan(p10) or math.isnan(p01) or math.isnan(p11) or
        math.isnan(r00) or math.isnan(r10) or math.isnan(r01) or math.isnan(r11)):
        return (float('nan'), float('nan'))
    
    # Bilinear interpolation
    di = fi - i0
    dj = fj - j0
    w00 = (1.0 - di) * (1.0 - dj)
    w10 = di * (1.0 - dj)
    w01 = (1.0 - di) * dj
    w11 = di * dj
    
    pitch = w00 * p00 + w10 * p10 + w01 * p01 + w11 * p11
    roll = w00 * r00 + w10 * r10 + w01 * r01 + w11 * r11
    
    return (pitch, roll)


def _fk_newton_raphson(q_lower, q_upper, pitch_init, roll_init, max_iter=5):
    """
    Newton-Raphson solver for FK.
    Returns (pitch, roll, converged).
    """
    p = pitch_init
    r = roll_init
    
    for _ in range(max_iter):
        r_low = _fk_residual_lower(p, r, q_lower, q_upper)
        r_upp = _fk_residual_upper(p, r, q_lower, q_upper)
        
        if abs(r_low) < 1e-10 and abs(r_upp) < 1e-10:
            return (p, r, True)
        
        j11 = _fk_jac_11(p, r, q_lower, q_upper)
        j12 = _fk_jac_12(p, r, q_lower, q_upper)
        j21 = _fk_jac_21(p, r, q_lower, q_upper)
        j22 = _fk_jac_22(p, r, q_lower, q_upper)
        
        det = j11 * j22 - j12 * j21
        if abs(det) < 1e-12:
            return (p, r, False)
        
        p += (-j22 * r_low + j12 * r_upp) / det
        r += (j21 * r_low - j11 * r_upp) / det
    
    return (p, r, False)


def fk_motor_to_foot(q_lower, q_upper):
    """
    Compute foot angles from motor angles using LUT + Newton-Raphson.
    
    Args:
        q_lower: Lower motor angle [rad]
        q_upper: Upper motor angle [rad]
    
    Returns:
        (pitch, roll): Foot angles [rad], or (nan, nan) if failed
    """
    p_init, r_init = _fk_lut_lookup(q_lower, q_upper)
    
    # Fall back to cold start if LUT returns NaN
    if math.isnan(p_init) or math.isnan(r_init):
        p_init, r_init = 0.0, 0.0
    
    pitch, roll, converged = _fk_newton_raphson(q_lower, q_upper, p_init, r_init)
    return (pitch, roll)


def fk_motor_to_foot_fast(q_lower, q_upper):
    """
    Compute foot angles from motor angles using LUT only (fastest, ~0.001 error).
    
    Args:
        q_lower: Lower motor angle [rad]
        q_upper: Upper motor angle [rad]
    
    Returns:
        (pitch, roll): Foot angles [rad], or (nan, nan) if outside workspace
    """
    return _fk_lut_lookup(q_lower, q_upper)

# ==========================================
# IK JACOBIAN
# ==========================================

def ik_jacobian(pitch, roll):
    """
    Compute IK Jacobian: d(q_lower, q_upper) / d(pitch, roll).
    
    Args:
        pitch: Foot pitch angle [rad]
        roll: Foot roll angle [rad]
    
    Returns:
        (j11, j12, j21, j22): Jacobian elements in row-major order
    """
    return (
        _ik_jac_11(pitch, roll),
        _ik_jac_12(pitch, roll),
        _ik_jac_21(pitch, roll),
        _ik_jac_22(pitch, roll)
    )

# ==========================================
# HIGH-LEVEL API
# ==========================================

def get_foot_state(q_lower, q_upper, v_q_lower, v_q_upper, tau_q_lower, tau_q_upper):
    """
    Convert motor measurements to foot state.
    
    Args:
        q_lower, q_upper: Motor positions [rad]
        v_q_lower, v_q_upper: Motor velocities [rad/s]
        tau_q_lower, tau_q_upper: Motor torques [Nm]
    
    Returns:
        (pitch, roll, v_pitch, v_roll, tau_pitch, tau_roll) or None if failed
    """
    pitch, roll = fk_motor_to_foot(q_lower, q_upper)
    if math.isnan(pitch) or math.isnan(roll):
        return None
    
    j11, j12, j21, j22 = ik_jacobian(pitch, roll)
    det = j11 * j22 - j12 * j21
    if abs(det) < 1e-12:
        return None
    
    v_pitch = (j22 * v_q_lower - j12 * v_q_upper) / det
    v_roll = (-j21 * v_q_lower + j11 * v_q_upper) / det
    
    tau_pitch = (j22 * tau_q_lower - j21 * tau_q_upper) / det
    tau_roll = (-j12 * tau_q_lower + j11 * tau_q_upper) / det
    
    return (pitch, roll, v_pitch, v_roll, tau_pitch, tau_roll)


def get_motor_commands(pitch, roll, v_pitch, v_roll, tau_pitch, tau_roll):
    """
    Convert foot targets to motor commands.
    
    Args:
        pitch, roll: Foot positions [rad]
        v_pitch, v_roll: Foot velocities [rad/s]
        tau_pitch, tau_roll: Foot torques [Nm]
    
    Returns:
        (q_lower, q_upper, v_q_lower, v_q_upper, tau_q_lower, tau_q_upper)
    """
    q_lower, q_upper = ik_foot_to_motor(pitch, roll)
    j11, j12, j21, j22 = ik_jacobian(pitch, roll)
    
    v_q_lower = j11 * v_pitch + j12 * v_roll
    v_q_upper = j21 * v_pitch + j22 * v_roll
    
    tau_q_lower = j11 * tau_pitch + j21 * tau_roll
    tau_q_upper = j12 * tau_pitch + j22 * tau_roll
    
    return (q_lower, q_upper, v_q_lower, v_q_upper, tau_q_lower, tau_q_upper)